import{_ as a,c as i,ah as t,o}from"./chunks/framework.BWXOFiC5.js";const b=JSON.parse('{"title":"Miscellaneous Interface Pages","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/Administration/misc-interface-pages.md","filePath":"Documentation/Administration/misc-interface-pages.md"}'),n={name:"Documentation/Administration/misc-interface-pages.md"};function r(s,e,l,h,c,u){return o(),i("div",null,e[0]||(e[0]=[t('<h1 id="miscellaneous-interface-pages" tabindex="-1">Miscellaneous Interface Pages <a class="header-anchor" href="#miscellaneous-interface-pages" aria-label="Permalink to &quot;Miscellaneous Interface Pages&quot;">​</a></h1><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This pages is the home for interface pages that need minimal documentation. These are typically pages that provide information, or are otherwise simple in nature.</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><p>An active ImmyBot subscription or <a href="https://www.immy.bot/pricing/" target="_blank" rel="noreferrer">trial</a></p><h2 id="notifications" tabindex="-1">Notifications <a class="header-anchor" href="#notifications" aria-label="Permalink to &quot;Notifications&quot;">​</a></h2><h3 id="objective" tabindex="-1">Objective <a class="header-anchor" href="#objective" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>Provides a single pane of glass for all notifications sent to your user</li></ul><h3 id="navigation" tabindex="-1">Navigation <a class="header-anchor" href="#navigation" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Notifications</strong></li></ul><h2 id="media" tabindex="-1">Media <a class="header-anchor" href="#media" aria-label="Permalink to &quot;Media&quot;">​</a></h2><h3 id="objective-1" tabindex="-1">Objective <a class="header-anchor" href="#objective-1" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>Provides a list of icons that can be attached to various items in ImmyBot</li></ul><h3 id="navigation-1" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-1" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Media</strong></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>ImmyBot managed media cannot be deleted.</p></div><h2 id="tags" tabindex="-1">Tags <a class="header-anchor" href="#tags" aria-label="Permalink to &quot;Tags&quot;">​</a></h2><h3 id="objective-2" tabindex="-1">Objective <a class="header-anchor" href="#objective-2" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>Provides a list of tags available in your instance.</li></ul><h3 id="navigation-2" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-2" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Tags</strong></li></ul><h3 id="description" tabindex="-1">Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;Description&quot;">​</a></h3><p>You can create and manage Tags from this page. Tags are used to target tenants and computers for specific deployments.</p><h2 id="inventory" tabindex="-1">Inventory <a class="header-anchor" href="#inventory" aria-label="Permalink to &quot;Inventory&quot;">​</a></h2><h3 id="objective-3" tabindex="-1">Objective <a class="header-anchor" href="#objective-3" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>These tasks will be run on their specified schedules and will run their specified scripts on devices to collect system information for the purpose of inventorying the devices within immy.bot. The data collected by these scripts is stored on the Computer object under the &#39;inventory&#39; column. The results of each script will be nested under the &quot;inventory key&quot; specified by the script. These results are accessible from the Computer Details page.</li></ul><h3 id="navigation-3" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-3" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Inventory</strong></li></ul><h2 id="system-update" tabindex="-1">System Update <a class="header-anchor" href="#system-update" aria-label="Permalink to &quot;System Update&quot;">​</a></h2><h3 id="objective-4" tabindex="-1">Objective <a class="header-anchor" href="#objective-4" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>This page gives you the configuration page for System Updates to your ImmyBot instance, specifically the Release Channel and if there is an update available, an update now button.</li></ul><h3 id="navigation-4" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-4" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>System Update</strong></li></ul><h2 id="audit" tabindex="-1">Audit <a class="header-anchor" href="#audit" aria-label="Permalink to &quot;Audit&quot;">​</a></h2><h3 id="objective-5" tabindex="-1">Objective <a class="header-anchor" href="#objective-5" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>This page gives you the audit information for most things that happen in you&#39;re ImmyBot instance</li></ul><h3 id="navigation-5" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-5" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Audit</strong></li></ul><h2 id="oauth-tokens" tabindex="-1">OAuth Tokens <a class="header-anchor" href="#oauth-tokens" aria-label="Permalink to &quot;OAuth Tokens&quot;">​</a></h2><h3 id="objective-6" tabindex="-1">Objective <a class="header-anchor" href="#objective-6" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>This pages gives you the list of OAuth tokens in your instance.</li></ul><h3 id="navigation-6" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-6" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>OAuth Tokens</strong></li></ul><h3 id="description-1" tabindex="-1">Description <a class="header-anchor" href="#description-1" aria-label="Permalink to &quot;Description&quot;">​</a></h3><p>No credentials are shown in plain text; however, confidential information (such as Token IDs, Client IDs, etc.) is visible.</p><h2 id="locks" tabindex="-1">Locks <a class="header-anchor" href="#locks" aria-label="Permalink to &quot;Locks&quot;">​</a></h2><h3 id="objective-7" tabindex="-1">Objective <a class="header-anchor" href="#objective-7" aria-label="Permalink to &quot;Objective&quot;">​</a></h3><ul><li>This page gives you a list of ephemeral locks currently in use. Locks are used when a maintenance item needs to be run serially, such as the Change Name and Join Domain task.</li></ul><h3 id="navigation-7" tabindex="-1">Navigation <a class="header-anchor" href="#navigation-7" aria-label="Permalink to &quot;Navigation&quot;">​</a></h3><ul><li><strong>Show More</strong> &gt; <strong>Locks</strong></li></ul><h3 id="description-2" tabindex="-1">Description <a class="header-anchor" href="#description-2" aria-label="Permalink to &quot;Description&quot;">​</a></h3><p>You can delete locks, but you really only should do that if the endpoint looses connection to ImmyBot and the session is holding up a large onboarding push.</p><p><br><br><br></p><div class="note custom-block github-alert"><p class="custom-block-title">Document information</p><p>Author: Mark Gomez <br> Date Published: 09/19/2025 <br> Date Revised: N/A <br> Version Number: 1.0</p></div>',54)]))}const g=a(n,[["render",r]]);export{b as __pageData,g as default};
